import React from "react";

function Contact() {
  return (
    <div>
      <form className="flex">
        <h1>Contact me</h1>
        <h3>
          Ask questions, work with me, hire me, leave suggestions, leave
          compliments, insult me if you wish (no hard feelings)
        </h3>
      </form>
    </div>
  );
}

export default Contact;
